        StatusBitsGuidanceGoetting.tchar[5] = (int)strtol(nNodeType->VALEUR_HEXA_ASCII_DATA5_PDO, NULL, 16);

        fprintf(O_FILE_2, "Goetting : \r");
        fprintf(O_FILE_2, "%d : \r", StatusBitsGuidanceGoetting.tchar[0]);
        fprintf(O_FILE_2, "%d : \r", StatusBitsGuidanceGoetting.tchar[1]);
        fprintf(O_FILE_2, "%d : \r", StatusBitsGuidanceGoetting.tchar[2]);
