void PDO3DetailsDrivers(tNode *nNodeType, bool fChoice)
{
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA0_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA0);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA1_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA1);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA2_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA2);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA3_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA3);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA4_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA4);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA5_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA5);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA6_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA6);
    strcpy(nNodeType->VALEUR_HEXA_ASCII_DATA7_PDO, LigneEnCours.VALEUR_HEXA_ASCII_DATA7);

    concatener2BytesData(nNodeType->VALEUR_HEXA_ASCII_DATA1_PDO, nNodeType->VALEUR_HEXA_ASCII_DATA0_PDO, nNodeType->VALEUR_HEXA_ASCII_DATA0_1_PDO);
    concatener4BytesData(nNodeType->VALEUR_HEXA_ASCII_DATA5_PDO, nNodeType->VALEUR_HEXA_ASCII_DATA4_PDO, nNodeType->VALEUR_HEXA_ASCII_DATA3_PDO, nNodeType->VALEUR_HEXA_ASCII_DATA2_PDO, nNodeType->VALEUR_HEXA_ASCII_DATA2_3_4_5_PDO);
    /*
     * nNodeType->DriversActualCurrent is a value measured in one per thousand
     * nNodeType->DriversMotorRatedCurrent is stored when reading SDO Index 0x6065 and initialized at 10 000
     * It is measured in milliAmps and would correspond to the max autorized current on the driver board.
     * nNodeType->DriversMotorRatedCurrent is mapped on the PDO3.
     */
    nNodeType->DriversActualCurrent = (short int)strtol(nNodeType->VALEUR_HEXA_ASCII_DATA0_1_PDO, NULL, 16);
    nNodeType->DriversActualCurrentComputed = (nNodeType->DriversActualCurrent * nNodeType->DriversMotorRatedCurrent) / 1000;
    nNodeType->DriversPositionCount = (short int)strtol(nNodeType->VALEUR_HEXA_ASCII_DATA2_3_4_5_PDO, NULL, 16);

    if (fChoice)
    {
        //fprintf(CSVO_FILE, "%d;",nNodeType->DriversActualCurrent);
        //fprintf(CSVO_FILE, "MotorRatedCurrent : %d;",nNodeType->DriversMotorRatedCurrent);
        fprintf(CSVO_FILE, "Actual Current : %d mA;", nNodeType->DriversActualCurrentComputed);
        fprintf(CSVO_FILE, "Position Count : %d;", nNodeType->DriversPositionCount);
    }
    else
    {
        //fprintf(CSVD_FILE, "%d;",nNodeType->DriversActualCurrent);
        //fprintf(CSVD_FILE, "MotorRatedCurrent : %d;",nNodeType->DriversMotorRatedCurrent);
        fprintf(CSVD_FILE, "Actual Current : %d mA;", nNodeType->DriversActualCurrentComputed);
        fprintf(CSVD_FILE, "Position Count : %d;", nNodeType->DriversPositionCount);
    }
}

